Welcome to the OilField Engineer App!  
We are here to provide enrichment and make a difference in your job.

App was reviewed and approved by API.

Application is made for oilfield engineers / specialists. It is an supporting tool which will help to improve engineers / specialists daily operations. Easy to use and simple.

App Features:

- Oil and Gas News generator - which is collect all news from Internet about Oil and Gas;
- Oilfield Calculations ( more than 300 drilling, production and workover calculators);
- Reference - All Tables and Data about Drill Collar, Drill Pipe, Casing and other;
- Crude Oil and Gas market online price;
- Oil and Gas converter;

